import React from 'react';
import './viewer.css';

import fraImg from './videos/far.jpg';
import fraImg2 from './videos/fer2.jpg';

import rolImg from './videos/rol.jpg';
import rolImg2 from './videos/rol2.jpg';
import marImg from './videos/mar.jpg';
import marImg2 from './videos/mar2.jpg';
import larImg from './videos/lar.jpg';
import larImg2 from './videos/lar2.jpg';
import { Fade } from 'react-awesome-reveal';
const Viewer = (props) => {
    return (
        <div className="container">
            <div className="viewer-container">
                <Fade bottom>
                    <div className="viewer-wrap">
                        <img src={fraImg} alt="" />
                        <img src={fraImg2} alt="" className='video' />
                    </div>
                </Fade>
                <Fade bottom>
                    <div className="viewer-wrap">
                        <img src={marImg} alt="" />
                        <img src={marImg2} alt="" className='video' />
                    </div>
                </Fade>
                <Fade bottom>

                    <div className="viewer-wrap">
                        <img src={rolImg} alt="" />
                        <img src={rolImg2} alt="" className='video' />
                    </div>
                </Fade>
                <Fade bottom>
                    <div className="viewer-wrap">
                        <img src={larImg} alt="" />
                        <img src={larImg2} alt="" className='video' />
                    </div>
                </Fade>
            </div>
        </div>
    );
};

export default Viewer;
